import React from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './Login.module.css';

const Login = () => {
  const navigate = useNavigate();

  return (
    <div className={styles.container}>
      <div className={styles.box}>
        <h1 className={styles.title}>Portal do Funcion√°rio</h1>
        <form>
          <div className="form-group">
            <label htmlFor="cpf">CPF</label>
            <input type="text" className="form-control" id="cpf" />
          </div>
          <div className="form-group">
            <label htmlFor="senha">Senha</label>
            <input type="password" className="form-control" id="senha" />
          </div>
          <button type="button" className="btn btn-primary w-100 mt-" onClick={() => navigate('/Menu')}>
            Entrar
          </button>
          <button type="button" className="btn btn-secondary w-100 mt-2" onClick={() => navigate('/')}>
            Voltar
          </button>
        </form>
        <p className={styles.rodape}>Desenvolvido por Leonardo Dias</p>
      </div>
    </div>
  );
};

export default Login;
